Get Aggregates._virtualQueryString:
function (source, callback) {

	var aggRows = [],
			aggs = {'Key': 'all'},
	    cols = ['AltitudeMeters', 'DistanceMeters', 'HeartRate', 'Pace', 'Seconds'],
			columns = ['Key', 'Value'],
	    fns = ['avg', 'max', 'min'],
	    max = {},
			meta = {
	        'Key': 9,
	        'Value': 11
	    };

		aggRows.push(aggs);

		_.each(cols, function(col) {
		    var agg,
			data = _.map(source.rows, col);

			_.each(fns, function(fn) {
			    switch (fn) {
				    case 'avg':
						agg = Math.floor(_.mean(data));
						break;
					case 'max':
						agg = _.max(data);
						break;
					case 'min':
						 agg = _.min(data);
						break;
				}

				agg = agg || 0;

				aggRows.push({
					'Key': fn + col,
					'Value': agg
				});

				aggs[fn + col] = agg;
				columns.push(fn + col);
				meta[fn + col] = 11;
			});
		});

	// format time
	aggs.formattedTime = Tools.convertValueToDuration(aggRows[0].maxSeconds * 1000).format('mm:ss');
	columns.push('formattedTime');
	meta.formattedTime = 9;

	callback({
	    meta: meta,
	    columns: columns,
	    rows: aggRows
	});
}

Point in Time._virtualQueryString:
function (source, selected,  callback) {

	var selectedRow = {
			Time: Tools.convertISODatetimeToKDBLikeObject(selected)
		},
		index = _.sortedIndexBy(source.rows, selectedRow, function (row) {
			return row.Time.i;
	});

    callback({
		meta: source.meta,
		columns: source.columns,
		rows: [source.rows[index] || {}]
	});

}

